import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ComplicationOsteoporose } from 'src/app/models/ComplicationOsteoporose';
import { OsService } from 'src/app/services/os.service';

@Component({
  selector: 'app-os',
  templateUrl: './os.component.html',
  styleUrls: ['./os.component.css']
})
export class OsComponent {
  ComplicationOsteoporose: ComplicationOsteoporose = new ComplicationOsteoporose();
  errorMessage: string = '';

  constructor(private OsService: OsService) {}
 

  onSubmit() {  
    this.OsService.addos(this.ComplicationOsteoporose).subscribe(
      response => {
        console.log('Complication added successfully', response);
        this.errorMessage = '';
      },
      (error: HttpErrorResponse) => {
        console.error('Error adding Complication', error);
        this.errorMessage = error.error.title;
        if (error.error.errors) {
          for (const [field, errors] of Object.entries(error.error.errors)) {
            console.error(`Validation error for ${field}:`, errors);
          }
        }
      }
    );
  }
  
}
